            <a href="/">
                <h3 class="mt-0.5 text-lg font-medium text-gray-900"> {nomEntreprise} - <strong>{contrat}</strong> - {metier}</h3>
            </a>

            <p class="mt-2 line-clamp-3 text-sm/relaxed text-gray-500"> {dateDeDebut} - {dateDeFin} </p>

            </article>

        </>
    );
};

